import React from "react";
import "./index.css";
import Card from "./Cards";
import Sdata from "./Sdata";

// console.log(Sdata[0].sname);

const favSeries='netflix'
if(Sdata.title=='A Netflix Original Series'){
console.log('Netflix visiting');
}
else{
console.log('visit other platform');
}
const App = () =>(
    
  <>
    <h1 className="heading_style">List of top 5 Netflix Series in 2023</h1>
    {/* how to use map method  */}
    {Sdata.map((val, index) => {
      console.log(index);
      return (
        <Card
        key ={val.id}
          imgsrc={val.imgsrc}
          title={val.title}
          sname={val.sname}
          link={val.link}
        />
      );
    })}
  </>
)
export default App;
